import React, { useEffect, useState } from "react";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const [error, setError] = useState("");
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        console.log("Token from localStorage:", token);

        const response = await fetch("https://qa-uaesaas-api.instapract.ae/web/api/doctor/doc-list", {
          method: "GET",
          headers: {
            "Content-Type": "application/json",
            APPID: "Gem3s12345",
            Authorization: `Bearer ${token}`,
          },
        });

        console.log("API Status:", response.status);

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && data.success && Array.isArray(data.data)) {
          setDoctors(data.data);
          setError("");
        } else {
          setError(data.msg || "Failed to fetch doctor list.");
          setDoctors([]);
        }
      } catch (err) {
        console.error("Fetch error:", err);
        setError("Something went wrong while fetching doctor list.");
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      setError("Login required. Token not found.");
      console.warn("Token not found in localStorage.");
    }
  }, [token]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>

      {error && <p className="text-red-500 mb-4">{error}</p>}

      {doctors.length === 0 && !error ? (
        <p className="text-gray-500">No doctors found.</p>
      ) : (
        <ul className="space-y-2">
          {doctors.map((doc, index) => (
            <li key={index} className="p-3 border rounded shadow">
              <span className="font-semibold">
                {doc.name || doc.full_name || doc.doctor_name || "No Name"}
              </span>{" "}
              -{" "}
              <span className="text-gray-600">
                {doc.speciality || doc.specialty || "No Speciality"}
              </span>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default DoctorList;
